import React from 'react'

export default function Timetable(prop) {
  return (
    <div style={{
          marginLeft: props.isExpanded
            ? window.innerWidth < 768
              ? "3rem"
              : "11.5rem"
            : window.innerWidth > 768
            ? "3rem"
            : "3rem",
        }}>
      
      <h1>hello</h1>
    </div>
  )
}
